import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header'; // Ensure this matches the file name
import HomePage from './components/HomePage';
import './App.css';

const App = () => {
  return (
    <Router>
      <div className="app">
        <Header />
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/products" element={<h2>Products Page</h2>} />
          <Route path="/testimonials" element={<h2>Testimonials Page</h2>} />
          <Route path="/contact" element={<h2>Contact Page</h2>} />
          <Route path="/login" element={<h2>Login Page</h2>} />
          <Route path="/register" element={<h2>Register Page</h2>} />
          <Route path="/my-account" element={<h2>My Account Page</h2>} />
        </Routes>
        <footer className="footer">
          <p>Â© 2025 Velvet Lifestyle. All rights reserved.</p>
        </footer>
      </div>
    </Router>
  );
};

export default App;
